import { useSelector, useDispatch } from 'react-redux';
import CoinList from '../components/CoinList';

function CoinContainer() {
    let CoinUpditName = useSelector((state) => state.Coin.upbitTotalNames);
    let marketNamesArr = [];

    if (CoinUpditName) {
        marketNamesArr = Object.keys(CoinUpditName.data);
    }

    return (
        <div>
            {
                marketNamesArr.map((coin) =>
                    <div>
                        {coin}
                        &nbsp;
                        <span>
                            {
                                <CoinList coins={coin} />
                            }
                        </span>
                    </div>
                )
            }

        </div>
    )
}

export default CoinContainer;
